import React from 'react'
import config from '../config'

const Home = props => {

    const logout = () => {

        config.auth().signOut()

    }
    return (
        <div>
            Home Page
        <div>
                <button onClick={logout}> LOGOUT</button>
            </div>
        </div>

    )



}
